    public int lengthOfLongestSubstring(String s) {
        int p=0;
        int q=0;
        int max=0;
        while(q<s.length()){
            char c=s.charAt(q);
            int index=(int)c;
            int nextIndex=-1;
            if(q<s.length()-1){
                nextIndex=(int)s.charAt(q+1);
            }
            if(hasElement[index]>0){
                if(q-p>max){
                    max=q-p;
                }
                int realIndex=(int)s.charAt(p);
                for(int i=hasElement[index]-2;i>=p;i--){
                    hasElement[realIndex]=0;
                    realIndex=next[realIndex];
                }
                p=hasElement[index];
            }else{
                if(q==s.length()-1){
                    if(q-p+1>max){
                        max=q-p+1;
                    }
                }
            }

                hasElement[index]=q+1;
                next[index]=nextIndex;
                q++;
        }
        return max;
    }


